import Mock from 'mockjs'

Mock.mock('/user/room',{
    id: 1,
    img: 'img',
    roomType: 'type',
    usageRate: 'high'
});
Mock.mock('/user/reservation',{
    id: 1,
    roomId: 1,
    userId: 1,
    start: '1-1-2000',
    end: '1-1-2000'
});
Mock.mock('/admin/room',{
    id: 1,
    roomId: 1,
    userId: 1,
    start: '1-1-2000',
    end: '1-1-2000'
});
Mock.mock('/admin/reservation',{
    id: 1,
    roomId: 1,
    userId: 1,
    start: '1-1-2000',
    end: '1-1-2000'
});
